import tatiyeNet,{elDOM}  from "../es6.js"; 
export function myMultiple(resheader,inikey) { 
 var setEl=elDOM('modal','multiple');
 var css=inikey.width.split('x');
 if (css[1]) {
    var wh=css[0]+'px';
    var ml='margin-left:'+css[1]+'px';

 } else {
    var ml='';
    var wh=inikey.width;
 }
 // console.log(resheader)
 let myModal=`
 <div id="${resheader}" class="modal2" data-headerkey="${resheader}">
 <form id="form_${resheader}"  method="POST" enctype="multipart/form-data"> 
        <div class="modal-contentNg">
            <div  style="margin:auto;  width:${wh}; ${ml}">
              ${setEl.template}
            </div>  
          </div>  
   </form> 
</div>   
`;
return myModal;


};

